import Estilo from '../Hojas de Estilos/ItemCarrucel.css';
function ItemCarrucel(){
    return(
        <>
            <div className="item-carrucel">
                <h1 className="item-carrucel-titulo">Horacio escola</h1>
                <p className="item-carrucel-texto">Lorem ipsum dolor sit, amet consectetur adipisicing elit. Vitae, dolorum accusantium alias repellat laudantium quas deleniti nostrum, adipisci numquam ut rerum debitis quod optio, veniam amet ab ratione consequatur mollitia?</p>
            </div>
        </>
    )
}

export default ItemCarrucel;
